export function reducer(state, action) {
    switch (actioN.type) {
        case 'OPEN_MODAL':
            return {
                ...state,
            }
        case 'SAVE_PIN':
            return {
                ...state,
            }
        case 'CLOSE_PIN':
            return {
                ...state,
            }
    }

    return state;
}
